import React, {useEffect, useState} from 'react';
import {fetchCategories} from "../../http/itemsAPI";

const AdminTopBar = () => {
    const [categories,setCategories] = useState<string[]>()


    useEffect(() => {
        fetchCategories().then(data => setCategories(data))
    }, [])

    return (
        <div>
            {categories.map(i => (
                <div></div>
            ))}
        </div>
    );
};

export default AdminTopBar;
